    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE + col2 <> ( + - ( col2 ) + + + col0 + + 46 * + 90 + - ( + - col0 ) - + + col2 / 24 );
  - name: tab1

outputs:
  - name: q10339.out
    data: |
      51	14	96
      85	5	59
      91	47	68
